(20685, 20732, 0, 1, 'Can''t escaped-demo', '', '2010-01-10 00:00:00', 2000, 0, 2, 7, '懸掛在黑幕中的赤月\r\n像斑剝的碎片 映在塵埃的地平線 \r\n\r\n遺留在紅毯上的琴弦\r\n呢喃著 這場夢魘 無法停歇\r\n\r\n\r\n盡頭後沒有出口\r\n無力的握著拳頭\r\nI want to escaped\r\nWhy should be alone\r\n\r\n看不清誰的醜陋\r\n無止盡虛偽臉孔\r\nI want to leave this place\r\nLet me be myself\r\n\r\n\r\n眼角淚滴模糊了視線\r\n我臉上的疲憊 只能用酒精來麻醉\r\n\r\n沉澱不安的藍色菸圈\r\n周旋在 破碎的黎明夜\r\n\r\n\r\n盡頭後沒有出口\r\n無力的握著拳頭\r\nI want to escaped\r\nWhy should be alone\r\n\r\n看不清誰的醜陋\r\n無止盡虛偽臉孔\r\nI want to leave this place\r\nLet me be myself\r\n\r\n\r\n盡頭後沒有出口\r\n無力的握著拳頭\r\nI want to escaped\r\nWhy should be alone\r\n\r\n看不清誰的醜陋\r\n無止盡虛偽臉孔\r\nI want to leave this place\r\nLet me be myself\r\n\r\n鏡子理我的笑容\r\n提醒我放手一搏\r\nI want to escaped\r\nWhy should be alone\r\n\r\n看不透誰在捉弄\r\n你不懂你不是我\r\nI want to leave this place\r\nLet me be myself\r\n\r\n', '', 282, '', '兇澄', '兇澄', '兇澄', '獨立', '', 0, 0, 0, '2010-01-10 22:39:48', '2015-03-12 13:40:44', '0000-00-00 00:00:00'),
