(20694, 2294, 0, 1, '而我', '', '2010-01-12 00:00:00', 2046, 0, 1, 6, '<主歌>\r\n\r\n而我 不想在為你唱了\r\n因為 我都哭啞了\r\n而我 不想再為你寫詩\r\n妳走了 靈感都因你而逝\r\n\r\n<bride>\r\n我 不想不想不想\r\n在做無所謂的事\r\n我不想不想不想\r\n再笨一次\r\n\r\n<副歌>\r\n\r\n而我 \r\n反覆回想過好幾次  \r\n而妳 \r\n再也回不到最初的樣子\r\n\r\n是不是現在要開始收拾\r\n開始刮去最初的鬍子\r\n\r\n而那些年 \r\n就當作沒那回事\r\n\r\n<主歌>\r\n而我 不想再為妳笑了\r\n因為 開心的不是我\r\n\r\n而我 不想再為妳停留  \r\n因為 那些都過去了', '', 226, '', '子軒', '子軒', '子軒', '', '', 0, 1, 0, '2010-01-12 23:28:05', '2015-03-12 13:40:45', '0000-00-00 00:00:00'),
