(20729, 5603, 4027, 26, 'isolated illusion', '被強調出甚麼聲音並不是我想表達的，原本這段聲音是中文名為[粉紅噪音偽裝術]，建構在我還漠視著訊息的2004年，後來在2005年參加異響的特邀，我還很無厘頭的將它簡單但輕鬆的解釋了一次。\r\n\r\n持續聽著粉紅噪音一段時間後會覺得像是大量的人聲重疊在一起，就像在人聲鼎沸的擁擠城市重疊大量人聲之後也像是屏蔽著我們感官的圍牆\r\n\r\n王福瑞說[用聲音表達概念還蠻少見的]，他並不是很完全明白我所表達的。\r\n\r\n用表達當動詞很勉強而且很不適合，那只是孤單的放大，僅僅是感官上的，截取出來的。\r\n\r\n所以它的名字是isolated illusion....孤伶的錯覺', '2005-02-01 00:00:00', 2000, 0, 2, 3, '', '', 290, '', 'punkcan', '', '', '', '', 1, 1, 0, '2010-01-15 04:23:10', '2015-03-12 13:40:46', '0000-00-00 00:00:00'),
