(20753, 14803, 0, 1, '不想和你再見', '', '2010-01-17 00:00:00', 2000, 0, 2, 6, '你在後頭呼喚我\r\n我沒有停下腳步回頭\r\n早已過著不同的生活\r\n失去對你的純摯迷戀\r\n\r\n不停快轉的膠片\r\n播放你我存在的畫面\r\n是這世界賦予的美好\r\n或是永遠靜止不前\r\n\r\n\r\n你給我好多絢爛美麗的預言\r\n卻看見這之間充滿不安謊言與妥協\r\n\r\n莫非是我太愚昧…\r\n總想揮別過去 和當時的你不再見\r\n\r\n我已揮別過去 就當我們從未見面\r\n', '', 137, '', '小夏', '小夏', '', '', '', 0, 0, 1, '2010-01-17 12:29:47', '2013-10-07 17:15:31', '0000-00-00 00:00:00'),
(20754, 15514, 0, 1, '郵差先生人好好', '23號半成團週年慶，辦了一個寄明信片一起許願的活動，\r\n怎知鬧了點小烏龍，明信片差點迷了路!\r\n幸好，郵差先生人好好~~~~\r\n我們才得以找回這些差點走丟的雪花們!!\r\n\r\n這首歌，感謝辛苦的郵差先生~~~', '2010-01-18 00:00:00', 2000, 0, 2, 5, '唉唷威壓不得了  我的明信片找不到\r\n郵差先生問我  你那邊是幾號\r\n我說我不知道\r\n\r\n郵差先生人好好  他說別急別急我幫你找找\r\n只要你能確定沒有胡說八道\r\n比二十三多半號\r\n\r\n雪花  雪花  不是牛肉的雪花一片片  飛呀\r\n雪花  雪花  別迷路快回家', '', 119, '', '木偶', '木偶', '', '', '', 0, 1, 0, '2010-01-18 00:16:40', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
