(20757, 6673, 0, 2, '過重門', '', '2009-12-13 00:00:00', 2000, 0, 1, 7, '還記得小漢的時 舊厝的那塊埕\r\n咱厝邊頭尾源自同一房 蓮霧樹兒伴過竹籬笆 \r\n在那作風颱的那一晚 一粒一粒 滴下去 \r\n田中的白鷺鷥 每天在追田嬰 (蜻蜓)\r\n\r\n還記得小漢的時 舊厝的那塊埕\r\n咱厝邊頭尾源自同一房\r\n\r\n還記得小漢的時 舊厝的那塊埕\r\n咱厝邊頭尾源自同一房 蓮霧樹兒伴過竹籬笆\r\n日頭在午后 一吋一吋 沉下去 西邊的鹽埕埔\r\n港邊的海浪 將咱拆分開\r\n\r\n新正過年 家族的大團圓\r\n圍爐了後 阿嬤在唱歌仔戲\r\n為訪枝頭花開早 輕聲慢步 過重門 過重門\r\n', '', 236, '', '林育詳', '林育詳', '風籟坊', '小白兔唱片', '', 1, 1, 0, '2010-01-18 17:45:06', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
(20758, 6673, 0, 4, '夏至', '', '2009-12-13 00:00:00', 2000, 0, 1, 7, '時間緊緊 熱天又要過\r\n黑雲在天頂飛\r\n踏著溝兒尾浸水的怨切\r\n踏著溝兒尾浸水的怨切\r\n\r\n石柱下 一枝草\r\n大風吹 頭犁犁\r\n不好控制背景跟運勢\r\n不好控制背景跟運勢\r\n\r\n自由人生 低路歹過\r\n士農工商 天下一切\r\n哀傷吊樹頭 苦痛放水流\r\n親像稻兒目眉的風在吹\r\n熱天又要過 熱天又要過\r\n', '', 187, '', '林育詳', '林育詳', '風籟坊', '小白兔唱片', '', 1, 1, 0, '2010-01-18 17:46:35', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
(20759, 6673, 0, 3, '民國七十一', '', '2009-12-13 00:00:00', 2000, 0, 1, 7, '民國七十一年的花蓮市 \r\n北迴鐵路開通已經過三年\r\n還未習慣鐵路的這個港市\r\n每一尾船都有尹的代事\r\n伊騎著Kawasaki載着伊的牽手\r\n來到工地那排正在起的新厝\r\n圍籬花牽起大門的兩邊\r\n倉庫雨亭下有一間狗兒厝\r\n\r\n壓在屜兒底的會計簿兒頂\r\n舊年還未還了的人情\r\n看著囝兒手賤弄著晾衣的竹竿\r\n趕緊關電火較早睡一眠大一吋\r\n希望時間就停在這圓滿的一秒鐘\r\n希望時間就停在這圓滿的一秒鐘\r\n\r\n只有選舉那天厝內大人適好較有閒\r\n日頭照護著溫暖的海浪\r\n帶大漢小漢來去北濱兒的步垣那邊\r\n浮浮沉沉  浮浮沉沉  浮浮沉沉\r\n', '', 338, '', '林育詳', '林育詳', '風籟坊', '小白兔唱片', '', 1, 1, 0, '2010-01-18 18:07:15', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
(20760, 6673, 0, 5, '長途電話', '', '2009-12-13 00:00:00', 2000, 0, 1, 7, '住在鐵工廠已經有個外月\r\n平常沒甚麼時間通好打電話\r\n適出社會還在學工夫\r\n不知道厝內的所費甘會得過\r\n\r\n阿明自退伍了後就不愛講話\r\n陪頭家伴喏坐在壁角頭犁犁\r\n怕講不對話\r\n怕講不對話\r\n怕講不對話 \r\n其實都是看不過\r\n\r\n阿英今年大阮兩歲\r\n伊有一個後生今年適開始讀書\r\n有時晾完裳 伊會坐在宿舍的眠床頂\r\n牽著燻 牽著伊的怨切\r\n\r\n西門町又在落雨\r\n老阿伯曲在路邊收垃圾\r\n百貨公司的厝尾頂的霓紅燈 另外一邊 \r\n照著另外一邊\r\n\r\n悽慘的風景親像重拖的山 \r\n不敢照鏡因為感覺艱苦\r\n若喝Beer若在講笑話 \r\n面對著這大片坫兒膠的黑\r\n', '', 382, '', '林育詳', '林育詳', '風籟坊', '小白兔唱片', '', 1, 1, 0, '2010-01-18 18:10:41', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
(20761, 20880, 0, 1, '小叮当的夏天', '', '2010-01-18 00:00:00', 2010, 0, 2, 2, '小叮当的夏天 \r\n \r\n作词 李弦伦\r\n作曲 李弦伦\r\n编曲 李弦伦\r\n演唱 李弦伦\r\n \r\n \r\n啦啦啦啦...\r\n\r\n副歌进唱\r\n整个夏天被蝉鸣围绕\r\n有时候真像是你再歌唱\r\n那首歌是这样唱的没有谁能替代\r\nRAP\r\n我知道这个时候有太多话要说\r\n闷开家中已经有1234其实很多天\r\n没有白天只有黑夜其实谁也不想\r\n陪记忆失眠或许只有回忆最可怜\r\n耳边总会传来妈妈的细语\r\n叮嘱我记得吃饭顾好身体妈不在身边\r\n一切都靠你自己我很想说声爱你\r\n所以我用RAP来歌颂你的努力\r\n努力我仍需努力对于未来我需要故作镇定\r\n没有天上掉下的运气只有认真的前进\r\n就算没有结局也会看到灿烂的夏季我期待\r\n\r\n\r\n这个夏天一样的画面\r\n同样的调调又再次响起\r\n那首歌也是这样唱的只要你能快乐\r\nrap\r\n我知道这个年纪有太多的事要做\r\n要经历风雨有点勇气然后要很上进\r\n陌生的城市陌生的距离有时真想放弃\r\n回到原点来一次时光旅行\r\n可惜我没有小叮当的时光机\r\n也没有圣诞老人的坐骑\r\n我只有一颗大大的决心带我离开过去\r\n我要冲向山顶\r\n朋友总爱笑我不切实际我从不理会\r\n我要做的只是自己啊啊你们的好意\r\n就像妈妈说的那样做人只要开心\r\n就算没有结果我也会一个人活的美丽\r\n\r\n啦啦啦啦..啦啦啦啦啦.\r\n\r\n我微笑不是骄傲请听我继续诉说\r\n很多故事不同结尾都需要一些点缀\r\n悲伤的悲伤甜蜜的甜蜜剧情需要而已\r\n如果可以请不要哭泣\r\n可惜我不是小叮当的好朋友\r\n我只是会弹琴的小小小琴童\r\n朋友啊我们千万不要放弃\r\n路依然艰辛只要坚持你会看到奇迹\r\n\r\n啦啦啦啦..啦啦啦啦啦...\r\n\r\n小叮当的夏天说我们要加油', '', 198, '', '李弦伦', '李弦伦', '李弦伦', '', '', 0, 1, 0, '2010-01-18 21:13:28', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
