(20763, 23679, 0, 1, '我爱着，什么也不说', '收录在国内独立流行音乐厰牌--露水十一（Dew11）在今年3月发佈的最新诗歌合辑《歌声与诗句》中。\r\n灵感来源于《西方美术史》的序言，出自法国浪漫主义诗人缪塞（Alfred de Musset）一首名为“雏菊”的小诗。\r\n\r\n“最美丽的诗歌是最绝望的诗歌”，正如雏菊的花语：深藏在心底的爱。\r\n\r\n不抱任何希望地去爱，只要能见到爱人的脸，就能获得最大的满足。\r\n', '2010-01-20 00:00:00', 0000, 5, 0, 7, '我爱着，什么也不说  \r\n我爱着，只我心里知觉\r\n我珍惜我的秘密，也珍惜我的痛苦\r\n\r\n我曾宣誓我爱着，不怀抱任何希望\r\n但并不是没有幸福\r\n只要能看到你，我就感到满足。', '', 167, '', '赵一艾CanDee', 'Shakespeare', 'Yan One', 'Dew11', '', 1, 1, 0, '2010-01-20 10:59:21', '2015-03-12 13:40:47', '0000-00-00 00:00:00'),
